BEGIN;
INSERT INTO `articles` VALUES ('79', '2', null, 'Chaque maison propose un défi.', null, '1', '1'), ('80', '2', null, 'Effectue les demandes pour gagner des points.', null, '1', '1'), ('81', '2', null, 'Il se dit que ceux qui réussissent le labyrinthe peuvent changer de monde.', null, '1', '1'), ('82', '2', null, 'Tu sais qu\'il y a un moyen de monter dans les nuages.', null, '1', '1'), ('83', '2', null, 'Utilise les arbres pour accomplir tes demandes.', null, '1', '1'), ('84', '2', null, 'Comment vas tu ?', null, '1', '1'), ('85', '2', null, 'Le jardinier a encore fait des siennes.', null, '1', '1'), ('86', '2', null, 'Les caisses sont utilent pour sauter plus haut.', null, '1', '1'), ('87', '2', null, 'Je pense que c\'est plus pratique de jouer avec une manette.<br/>Et toi tu en pense quoi ?', null, '1', '1'), ('88', '2', null, 'Je fais une petite balade.', null, '1', '1'), ('89', '2', null, 'J\'ai déjà vu quelqu\'un monter en haut du grand arbre.', null, '1', '1'), ('90', '2', null, 'Si tu utilises la touche SHIFT tu avanceras plus vite.', null, '1', '1'), ('91', '2', null, 'La touche ESPACE te permet de sauter.', null, '1', '1'), ('92', '2', null, 'Si tu utilises une manette, tu peux inverser les commandes avec la touche SELECT', null, '1', '1'), ('93', '2', null, 'Si tu utilises une manette, la touche X remplace la touche ENTER', null, '1', '1'), ('94', '2', null, 'Si tu utilises une manette, tu peux sauter avec la touches B ou le clique joystick de droite.', null, '1', '1'), ('95', '2', null, 'As tu déjà visité la grotte ?', null, '1', '1'), ('96', '2', null, 'J\'ai mon propre potagé près d\'ici', null, '1', '1'), ('97', '2', 'Noël et le jour de l’an', 'Noël et le jour de l’an', 'Tous les ans, le 1er janvier et le 25 décembre.', '1', '1'), ('98', '2', 'Le trou', 'Combien de mètres cubes de terre contient un trou de 6 m de diamètre et de 3 m de profondeur ?', 'Aucun, sinon ce n’est plus un trou !', '1', '1'), ('99', '2', 'Les deux pièces', 'A la poste, Etienne reçoit 30 centimes en monnaie sous la forme de deux pièces. L’une des deux n’est pas une pièce de 10 centimes. Quelle est la valeur de chaque pièce ?', 'Une pièce de vingt centimes et une de dix centimes, car si l’une des pièces n’est pas une pièce de dix centimes, l’autre l’est !', '1', '1'), ('100', '2', 'L’arbre aux merles', 'Albert aperçoit seize merles sur le grand cerisier de son verger. Il tire un coup de chevrotines et sept merles tombent par terre. Combien en reste-t-il sur l’arbre ?', 'Plus aucun : les autres se sont envolés !', '1', '1'), ('101', '2', 'Partage difficile', 'J\'ai 9 enfants et 7 pommes. Comment je fais pour les partager de manière égale aux 9 enfants ?', 'Je fais de la compote!', '1', '1'), ('102', '2', 'Mois de 28 jours', 'Certains mois ont 30 jours et d\'autres en ont 31. Combien de mois ont vingt-huit jours ?', 'Tous les mois de l’année ont au moins vingt-huit jours !', '1', '1'), ('103', '2', 'La branche', 'Quand Bastien avait quatre ans, son père lui avait installé une balançoire en l’accrochant à la branche la plus basse du beau platane qui pousse dans leur jardin. Cette branche était à trois mètres de haut au-dessus du sol. trente ans plus tard, Bastien a un petit garçon de quatre ans. Le platane a poussé de 30 mètres. Bastien installe à son tour une balançoire pour son fils : à quelle hauteur se trouve la branche à présent ?', 'Toujours à trois mètres de hauteur. Les arbres grandissent par le haut ; le tronc s’épaissit mais ne s\'étire pas.', '1', '1'), ('104', '2', 'Les deux TGV', 'Un TGV part de Paris en direction de Marseille à 8 h. A la même heure, un autre TGV part de Marseille en direction de Paris. Lequel des deux sera le plus près de Lyon quand ils se croiseront ?', 'Quand ils se croiseront, ils seront au même endroit et donc à égale distance de Lyon.', '1', '1'), ('105', '2', 'Scier la bûche', 'Il faut une minute pour scier une bûche. Combien de temps sera nécessaire pour  couper une bûche en dix morceaux ?', 'Neuf minutes, puisqu’il faut couper neuf fois la bûche pour avoir dix morceaux.', '1', '1'), ('106', '2', 'Mal prononcé', 'Quel mot de trois lettres tout le monde prononce-t-il mal ?', 'Le mot « mal ».', '1', '1'), ('107', '2', 'Soustractions', 'Combien de fois peut-on soustraire cinq de vingt-cinq ?', 'Une fois. Après, on serait obligé de soustraire cinq de vingt !', '1', '1'), ('108', '2', 'Les timbres', 'Combien de timbres de trois euros y a-t-il dans une douzaine ?', 'Il y en a forcément douze dans une douzaine !', '1', '1'), ('109', '2', 'Vision extra-murale', 'Une très vieille invention permet de voir à travers les murs d\'une maison. La connaissez-vous ?', 'La fenêtre.', '1', '1'), ('110', '2', 'La bouteille vide', 'Je suis capable de placer une bouteille vide au centre d’une pièce et y entrer en rampant. Comment puis-je y arriver ?', 'Ce n’est pas très difficile de rentrer dans une pièce en rampant !', '1', '1'), ('111', '2', 'La maison froide', 'Georges arrive dans sa résidence secondaire en plein hiver. Il y a une cheminée, des vieux journaux, du petit bois, une lampe à pétrole. Que va-t-il allumer en premier ?', 'Une allumette !', '1', '1'), ('112', '2', 'Liste rouge', '10 % des Français sont inscrits sur la liste rouge. Si on prend un annuaire de n\'importe quel département pour y choisir cent noms au hasard, combien de ces personnes y retrouverait-on ?', 'Aucune, puisqu\'elles ne sont pas inscrites dans l\'annuaire.', '1', '1'), ('113', '2', 'Prédiction', 'Je peux vous donner le score du prochain match de foot avant qu’il ne commence ! Comment puis-je être sûr de ne pas me tromper ?', 'Le score de n’importe quel match « avant qu’il ne commence » est toujours de zéro à zéro !', '1', '1'), ('114', '2', 'Les tas', 'Monsieur Roger et ses trois fils ramassent les feuilles mortes. Chacun a fait trois tas dans la cour. Devant la maison, ils ont fait ensemble sept tas. Quand ils les mettront tous ensemble, combien cela fera-t-il de tas ?', 'Un seul gros tas.', '1', '1'), ('115', '2', 'Le pompiste', 'Pendant les dernières vacances, je me déplaçais en voiture. Je me suis arrêté à une station-service pour faire le plein. Le pompiste est venu me servir. « Cela peut vous paraître bizarre, dit-il, mais je préfère remplir le réservoir de deux voitures qui ne sont pas du coin plutôt que de faire le plein d\'une voiture qui vient de la ville »\n​- Je vous comprends, lui ai-je dit.\nPourquoi ?', 'Faire le plein de deux voitures rapporte plus d\'argent au pompiste que le plein d\'une seule voiture, de toute façon !', '1', '1'), ('116', '2', 'Grenouille intelligente', 'Quelle syllabe rend les grenouilles intelligentes ?', '« Gre ».', '1', '1'), ('117', '2', 'Multi-usage', 'Avec quoi t\'assois-tu, dors-tu et te brosses-tu les dents?', 'Avec une chaise, un lit, une brosse à dents.', '1', '1'), ('118', '2', 'Un vrai chien', 'Quand un chien est-il vraiment un chien?', 'Quand il n’y en a qu’un, sinon ce sont des chiens.', '1', '1'), ('119', '2', 'Dur de la feuille', 'Comment appelle-t-on un lapin sourd ?', '« LAAAPINN !!! »', '1', '1'), ('120', '2', 'Pauvre chien !', 'Comment appelle-t-on un chien cul-de-jatte ?', 'On ne l’appelle pas, on va le chercher !', '1', '1'), ('121', '2', 'Loi funéraire', 'Tout Européen vivant en France peut-il être enterré dans son pays d’origine ?', 'S’il vit en France, il n’est pas encore mort et ne peut être enterré.', '1', '1'), ('122', '2', 'Les trois enfants', 'Jérémie a une mère. Cette mère a 3 enfants qui s\'appellent Titi, Toto et….', '… et Jérémie.', '1', '1'), ('123', '2', 'Course cycliste', 'Ernest participe au Tour de France. Il double le deuxième : quelle est sa place dans le peloton ?', 'Deuxième !', '1', '1'), ('124', '2', 'Le panier aux pommes', 'Un panier contient cinq pommes. Vous en prenez trois : combien en avez-vous ?', 'Trois : celles que vous avez prises !', '1', '1'), ('125', '2', 'Vers la plage', 'Me rendant à la plage, j\'ai croisé 6 hommes qui avaient chacun 6 femmes, chaque femme avait 6 enfants et chaque enfant avait 6 chats. Combien de personnes et d\'animaux se rendent à la plage ?', 'Une seule : moi !', '1', '1'), ('126', '2', 'La plus grande île', 'Quelle était la plus grande île au monde avant que l\'Australie ne soit découverte ?', 'C’était l’Australie.', '1', '1'), ('127', '2', 'Scrabble', 'Écrire un seul mot avec les lettres suivantes : N O T U L U S E M .', 'UN SEUL MOT.', '1', '1'), ('128', '2', 'Les trois comprimés', '- Je vous prescris trois comprimés. Vous en prendrez un toutes les demi-heures.\n- Pendant combien de temps, docteur ?\n- Calculez vous-même !', 'Une heure. On prendra le premier comprimé immédiatement, le deuxième dans une demi-heure, le troisième dans une heure.', '1', '1'), ('129', '2', 'Le bûcheron', 'Jacques Lacoupe fait payer 1 € pour couper une bûche en deux. Combien fait-il payer pour couper une bûche en quatre ?', 'Il demandera 3 € puisqu’il faut trois coupes pour obtenir quatre morceaux.', '1', '1'), ('130', '2', 'Les deux mères et les deux filles', 'Deux mères et deux filles prennent le thé. Chacune prend une part de gâteau alors que trois parts seulement ont été coupées. Pourtant chacune a été servie de la même façon. Comment est-ce possible ?', 'Il n’y a en fait que trois personnes : la grand-mère, la mère et sa fille. La mère est à la fois mère et fille.', '1', '1'), ('131', '2', 'Les moutons morts', 'Un fermier a 17 moutons. Tous sont morts sauf  9. Combien en reste t-il ?', 'Neuf, on vient de le dire.', '1', '1'), ('132', '2', 'Ben-Hur', 'Vous êtes en pleine antiquité romaine. Vous exercez le métier glorieux d’aurige : vous participez aux courses de chars. Chaque char a quatre chevaux ; pour gagner, il faut accomplir douze tours de piste et arriver premier parmi sept concurrents en lice ; le cirque contient 10 000 spectateurs. Quel est l’âge du conducteur du char ?', 'Quel âge avez-vous ?', '1', '1'), ('133', '2', 'Échec pour les champions', 'Le 15 juin 1993, A. Karpov et G. Kasparov, les deux plus grands joueurs d’échecs du moment, ont disputé cinq parties. Il n’y a eu aucune partie nulle (aucun Pat), aucune partie annulée, et les deux fameux joueurs ont remporté chacun cinq victoires par échec et mat. Comment est-ce possible ?', 'Ils ne jouaient pas l’un contre l’autre mais chacun dans un tournoi différent.', '1', '1'), ('134', '2', 'Organe alimentaire', 'Quel animal mange avec sa queue ?', 'Tous, aucun ne l’enlève pour cela.', '1', '1'), ('135', '2', 'Volatiles transversaux', 'Pourquoi les poules traversent-elles la route ?', 'C’est trop long d’en faire le tour.', '1', '1'), ('136', '2', 'Monstre', 'J’ai trois têtes, 10 bras, 5 jambes et trois pieds. Qui suis-je ?', 'Un gros menteur !', '1', '1'), ('137', '2', 'Ours vendu', 'Qu’est-ce qui est plus stupide que vendre la peau de l’ours avant de l’avoir tué ?', 'L’acheter.', '1', '1'), ('138', '2', 'Félin de couleur', 'Qu’est-ce qui suit toujours un chat noir ?', 'Sa queue', '1', '1'), ('139', '2', 'Métamorphose', 'Quel animal change facilement de tête ?', 'Le pou.', '1', '1'), ('140', '2', 'Vol', 'Qu’est-ce qu’un cambrioleur prend en dernier ?', 'La fuite.', '1', '1'), ('141', '2', 'Fruits exotiques', 'Comment ramasse-t-on la papaye ?', 'Avec une foufourche.', '1', '1'), ('142', '2', 'Malaise', 'Que faut-il faire quand on ne se sent pas bien ?', 'Se faire renifler par quelqu’un d’autre.', '1', '1'), ('143', '2', 'Domiciles colorés', 'La maison bleue est au bord de la mer, la maison rose est au coin de la rue, la maison verte est près du pont. Où est la maison blanche ?', 'A Washington.', '1', '1'), ('144', '2', 'Champion', 'Quel animal saute plus haut qu’une maison ?', 'A peu près tous ; une maison, ça ne saute pas bien haut…', '1', '1'), ('145', '2', 'Télespectateur', 'Pourquoi serez-vous tous devant la télévision ce soir ?', 'Parce qu’il n’y a rien à voir derrière.', '1', '1'), ('146', '2', 'Laitage', 'Comment fait-on les petits suisses ?', 'Comme les petits Français…', '1', '1'), ('147', '2', 'Drôle de mois', 'Janvier, ça commence par la lettre J, et pourtant, on l’écrit avec un P. Pourquoi ?', 'Parce que Pourtant commence par P.', '1', '1'), ('148', '2', 'Mondocentrisme', 'Quel est le centre du monde ?', 'La lettre n.', '1', '1'), ('149', '2', 'Agrume', 'Pourquoi n’est-il pas facile de manger du canard à l’orange ?', 'Parce que le feu passe très vite au vert.', '1', '1'), ('150', '2', 'Mouvement', 'Pourquoi un chien remue-t-il la queue ?', 'Parce que la queue ne peut pas remuer le chien.', '1', '1'), ('151', '2', 'Natation', 'Où apprend-on le mieux à nager ?', 'Dans l’eau.', '1', '1'), ('152', '2', 'Brièveté', 'Quel est le mois le plus court ?', 'Mai : il n’a que trois lettres.', '1', '1'), ('153', '2', 'Équitation', 'Pourquoi met-on une selle sur un cheval ?', 'Parce que dessous, on tombe.', '1', '1'), ('154', '2', 'Figure', 'J’ai trois nez, deux bouches, quatre yeux et cinq oreilles. Que suis-je ?', 'Horrible !', '1', '1'), ('155', '2', 'L’arche', 'Combien d’animaux de chaque espèce Moïse a-t-il accueilli dans son arche ???', 'Noé, je ne sais pas ; Moïse, lui, n’a jamais eu d’arche !', '1', '1'), ('156', '2', 'Le mur de la Terre', 'Le poids de la terre est évalué à six mille milliards de tonnes.\nCombien ce poids augmenterait-il si on utilisait mille milliards de tonnes de béton et de pierre pour construire un mur ?', 'Rien de plus, car les matériaux auraient été extraits de la Terre.', '1', '1'), ('157', '2', 'Déjeuner', 'Combien d’œufs peut-on manger le matin à jeun ?', 'Un seul car on n’est plus à jeun après.', '1', '1'), ('158', '2', 'La maison au soleil', 'L\'émir Abdul Ramaz est un milliardaire saoudien. Il aime tellement le soleil qu\'il a fait construire un palais rectangulaire dont les quatre murs sont tous face au sud. Comment est-ce possible ?', 'Il l\'a faite construire au pôle Nord.', '1', '1'), ('159', '2', 'Les huit parts', 'Comment couper un gâteau (carré, rectangulaire ou rond) en 8 parts avec seulement trois coups de couteau ?', 'On coupe d\'abord le gâteau en quatre en deux coups de couteau, puis une troisième fois horizontalement.', '1', '1'), ('160', '2', 'L’homme à la paille', 'Un jour, en se promenant dans le désert, vous trouvez un homme nu, mort depuis peu avec une paille à la main. Comment s\'est-il retrouvé là ?', 'Il faisait partie d’un voyage en montgolfière. Mais le ballon perdait de l’altitude et les passagers ont jeté tout le lest, puis tous leurs objets personnels, et finalement tous leurs vêtements. Ils continuaient à tomber. Ils ont tiré à la courte paille et le malheureux perdant a sauté par-dessus la nacelle.', '1', '1'), ('161', '2', 'L’œuf incassable', 'Debout sur une chaise, un œuf frais à la main, sans autre accessoire, je parie que je peux lui faire effectuer une chute de deux mètres de haut sur le carrelage en grès sans le casser. Comment puis-je réussir mon pari ?', 'Je vais le lâcher de plus de deux mètres de haut : pendant les deux premiers mètres de sa chute, il sera intact.', '1', '1'), ('162', '2', 'Entre ciel et terre', 'Qu\'est-ce que l\'on trouve toujours entre ciel et terre ?', 'Le mot « et ».', '1', '1'), ('163', '2', 'Roméo assassiné', 'Juliette a trouvé Roméo mort dans la cuisine. Il gisait dans une flaque d\'eau, au milieu de morceaux de verre brisé. Il n\'avait pas une égratignure. En voyant la fenêtre ouverte, Juliette a compris immédiatement qui était le responsable du crime. Et vous ?', 'Roméo est le poisson rouge de Juliette. Le chat est rentré par la fenêtre et a  renversé l\'aquarium.', '1', '1'), ('164', '2', 'Deux pères et deux fils', 'Au petit déjeuner, deux fils et deux pères mangent toujours une orange. Dans le pot il y a 3 oranges. Comment se fait-t-il que tout le monde en mange une ?', 'Il y a en fait le grand-père, le père et le fils. Le père est à la fois fils du grand -père et père du fils.', '1', '1'), ('165', '2', 'Le perroquet', 'Mme Bonnefoi ramène son nouveau perroquet chez l\'oiseleur.\n- Cela fait une semaine que je l\'ai acheté. Vous m\'aviez garanti qu\'il répétait absolument tout ce qu\'il entendait. Nous l\'avons installé au milieu du salon et toute la famille lui a parlé. Mais il n\'a jamais dit le moindre mot. Vous m\'avez menti !\n- Pas du tout madame.\n- Alors, pourquoi ne parle-il pas ?', 'Le perroquet est sourd.', '1', '1'), ('166', '2', 'Noël au balcon', 'Mon frère Étienne est né le 27 décembre, mais on fête son anniversaire en été. Pourquoi ?', 'Étienne vit dans l\'hémisphère sud.', '1', '1'), ('167', '2', 'Le lapin et le chou', 'Un lapin affamé a découvert un trou dans le grillage du potager. C\'est un petit trou, mais comme le lapin est très maigre, il réussit à passer à travers. Il se précipite sur le premier chou-fleur pour le manger. Il est au moins deux fois gros comme lui. Il réalise alors que s\'il le mange, il ne pourra jamais repasser par le trou étroit du grillage car il ne sera plus aussi maigre qu\'avant ! Et le chou est bien trop gros pour passer à travers le trou. Comment faire ?', 'Le lapin va tirer le chou au bord du grillage et le mangera à travers.', '1', '1'), ('168', '2', 'L’agrandissement du bassin', 'Au jardin public, il y a un petit bassin carré entre quatre arbres. On voudrait bien l\'agrandir, de façon à ce qu\'il soit deux fois plus grand tout en gardant une forme carrée. Mais on ne veut surtout pas couper les arbres. Comment faire ?', 'Il faut faire pivoter le carré de 45 ° : on peut alors doubler ses dimensions.', '1', '1'), ('169', '2', 'Traversée du désert', 'Personne ne peut survivre plus d\'une semaine sans boire. Pourtant Abdullah a effectué une traversée du désert sans emporter d\'eau et sans en rencontrer sur son chemin. Comment est-ce possible ?', 'Abdullah a traversé un désert du Grand Nord en mangeant de la neige et de la glace.', '1', '1'), ('170', '2', 'Tir aveugle', 'Je ne suis pas très doué au tir au pistolet, mais je peux sans problème suspendre mon chapeau, faire 50 mètres les yeux bandés, puis me retourner et transpercer ce chapeau d\'une seule balle. Comment ?', 'En accrochant le chapeau au bout du canon de mon pistolet !', '1', '1'), ('171', '2', 'Sur une feuille', 'Suzie et son petit frère n\'arrêtent pas de se bagarrer. Excédée, leur mère prend une feuille de journal, la pose par terre et leur demande à tous deux d\'y rester dessus dix minutes. Pendant ces dix minutes, aucun des enfants n\'a quitté la feuille mais aucun n\'est parvenu à toucher l\'autre ! Comment est-ce possible ?', 'La feuille de journal avait été glissée sous une porte et les enfants étaient placés chacun d\'un côté de la porte.', '1', '1'), ('172', '2', 'Qu’achète Arlette ?', 'Madame Arlette faire un achat pour sa maison. Elle examine les articles qu’on lui présente et demande à l’employé :\n- Combien cela fait-il pour un ?\n- Deux euros.\n- Ah ! Et pour douze ?\n- Quatre euros.\n- Et pour deux cents ?\n- Ca vous coûtera six euros.\nQu’est-ce que Madame Arlette achète ?', 'Elle achète un numéro pour sa maison.', '1', '1'), ('173', '2', 'Noir, c’est noir', 'La ville entière connaissait une panne d\'électricité qui dura plusieurs heures. Pendant la panne, un chien noir se tenait en plein milieu du croisement de deux routes. Aucun des réverbères ne fonctionnait, toutes les vitrines des magasins et toutes les lampes des maisons étaient éteintes. Une voiture dont les deux phares étaient brisés arriva en direction du chien. Elle freina à temps. Comment le conducteur avait-il pu apercevoir le chien ?', 'Cela se passait en plein jour.', '1', '1'), ('174', '2', 'Du sang au plafond', 'Alfred rend une visite à son ami Francis. Il le trouve étendu sur le canapé. Au plafond, juste au-dessus de la tête de Francis, il y a une tâche de sang frais, mais il n’y en a nulle part ailleurs. Alfred secoue son ami qui ouvre les yeux. Il va bien. Francis explique que c\'est bien son sang qui sèche plafond. Que s\'est-il passé ?', 'Francis avait tué un moustique qui s\'était régalé de son sang.', '1', '1'), ('175', '2', 'Marié à sa veuve', 'Comment un homme a-t-il pu épouser la sœur de sa veuve ?', 'Mais si, c\'est possible : il a divorcé pour se remarier avec la sœur de son ex-épouse. À sa mort, il avait bien épousé en premières noces la sœur de sa veuve.', '1', '1'), ('176', '2', 'Ascension inachevée', 'M. Martin habite au 35e étage d\'une tour moderne. Quand il rentre chez lui, il prend l\'ascenseur jusqu\'au 34e étage puis monte le dernier étage à pied. Cependant, quand il pleut, il prend l\'ascenseur jusqu\'au 35e étage. Qu\'est-ce qui explique son comportement ?', 'M. Martin est une personne de petite taille. Il ne peut atteindre le bouton du 35e étage sauf quand il a son parapluie.', '1', '1'), ('177', '2', 'Le serpent et le trésor', 'Le plus grand trésor de Ali Bubba est un fabuleux diamant. Ali fait partie des nomades du désert et il n\'est pas question pour lui de trimbaler un coffre-fort. Il pense avoir trouvé une protection parfaite : il l’a placé dans une boîte au couvercle coulissant, qui contient également un crotale dont la morsure tue instantanément.\nMais un matin, profitant d\'une courte absence, un voleur s\'introduit dans sa tente. À mains nues, sans aucun accessoire ni aucune protection, le voleur a pu s’emparer du diamant en quelques secondes. Ali a retrouvé la boîte intacte avec le serpent bien vivant à l\'intérieur. Comment le voleur a-t-il procédé ?', 'Il a retourné la boîte et a fait glisser le couvercle juste assez pour faire tomber le diamant.', '1', '1'), ('178', '2', 'Les deux cavaliers', 'Deux des cavaliers les plus rapides du royaume demandèrent la main de la fille du roi. Indécis, le roi proposa de départager les prétendants par une course de chevaux. Comme il avait affaire à deux champions, il s\'amusa à leur préciser : « Ma fille épousera celui dont le cheval passera en dernier la ligne d\'arrivée » Chacun des deux cavaliers voulait absolument épouser la fille du roi. On les vit se précipiter vers leurs chevaux, sauter en selle et partir à toute allure vers la ligne d\'arrivée. Pourquoi ?', 'Chacun est monté sur le cheval de l\'autre et veut lui faire passer la ligne d’arrivée en premier.', '1', '1'), ('179', '2', 'Téléphone reposant', 'Après une rude journée, Albert Léveillé espère passer une bonne nuit à l\'hôtel où il est descendu. Malheureusement, il n\'arrive pas à trouver le sommeil. Il décroche son téléphone et appelle la réception. Juste après avoir raccroché, il entend le téléphone sonner dans la chambre voisine. Il pousse un soupir et s\'endort tranquillement. Que s’est-il passé ?', 'Albert ne pouvait pas s\'endormir à cause du bruit des ronflements de son voisin de chambre. Il a demandé au réceptionniste d\'appeler celui-ci. La sonnerie du téléphone a interrompu son sommeil. Albert a soupiré de soulagement parce que les ronflements s\'étaient interrompus et a pu s\'endormir sans difficulté.', '1', '1'), ('180', '2', 'Lettre E', 'Qu\'est-ce qui commence par la lettre E et qui termine par la lettre E et qui ne contient qu\'une seule lettre ? (Ce n’est pas la lettre e !)', 'Une enveloppe.', '1', '1'), ('181', '2', 'Course-poursuite', 'Vous êtes au volant de votre voiture et vous roulez à vitesse constante. A votre droite, le vide à perte de vue. A votre gauche, un camion de pompiers qui roule à la même vitesse et dans la même direction que vous (En fait, il essaie de vous doubler.) Devant vous, un cochon qui est plus gros que votre voiture. Derrière vous, un hélicoptère qui vous suit en rase-mottes. Tous deux vont à la même vitesse que vous. Comment faites-vous pour vous arrêter ?', 'Vous descendez du manège.', '1', '1'), ('183', '2', 'Le rêve prémonitoire', 'Monsieur Édouard demande à Albert, son veilleur de nuit : « Réveillez-moi à 7 h demain matin, je dois prendre l\'avion pour New York ». Le lendemain, Albert réveille son patron et lui dit: « J\'ai rêvé que votre avion s\'écrasait, ne partez pas aujourd’hui ! » Monsieur Édouard suit son conseil, et apprend dans la journée que l’avion s’est écrasé. Il fait venir Albert et lui dit : « Merci, vous m\'avez sauvé la vie, vous êtes renvoyé ». Pourquoi ?', 'Albert avait donc dormi au lieu de faire son travail de veilleur de nuit.', '1', '1'), ('184', '2', 'Les homonymes', 'Nous sommes 3 homonymes.\nLe premier, prend un \"e\" au masculin.\nLe second, ne prend pas de \"e\" au féminin.\nLe troisième, prend un \"s\" au singulier.\nQuel est ce mot ?', 'Le mot foi (le foie, la foi, une fois)', '1', '1'), ('185', '2', 'Perte d’aiguille', 'Un homme se promène avec une aiguille. Au moment même où il la laisse tomber par terre, une grande panne de courant tombe dans la ville. Il se penche et retrouve son aiguille sans peine. Comment est-ce possible ?', 'Cela se passait en plein jour.', '1', '1'), ('186', '2', 'La sœur', 'Une dame embrasse une personne. Cette dame est la sœur de cette personne mais cette personne n\'est pas la sœur de cette dame. Comment est-ce possible?', 'La dame a embrassé son frère.', '1', '1'), ('187', '2', 'Père et mère', 'J\'ai un père mais je ne suis pas son fils, j\'ai une mère mais je ne suis pas son fils. Qui suis-je ?', 'Sa fille !', '1', '1'), ('188', '2', 'Le contenant incroyable', 'Qu\'est-ce qui est gros comme un pamplemousse et dans lequel on peut mettre toute l\'eau de la Terre ?', 'Une passoire.', '1', '1'), ('189', '2', 'Aîné important', 'Je suis l\'aîné d\'une famille de 26. Sans moi Paris serait pris. Qui suis-je ?', 'La lettre A.', '1', '1'), ('190', '2', 'La réponse impossible', 'Séraphin Kroquerie, mage réputé, se vante de pouvoir répondre avec exactitude à n\'importe quelle question concernant les évènements futurs. Mais Jean Dupont perspicace comme pas deux, trouve une question simple sur un évènement futur à laquelle S. Kroquerie ne peut apporter aucune réponse. \nQuelle est cette question ?', '« Allez-vous me répondre non ? »', '1', '1'), ('191', '2', 'La mouette', 'Henriette entre dans un restaurant. Elle commande de la mouette. Elle avale la première bouchée, hurle de terreur et s’effondre en larmes. Que s’est-il passé ?', 'Henriette a fait un voyage en bateau avec son mari. Il y a eu un naufrage. Elle et son mari ont fait partie des rescapés: ils ont échoué sur une île déserte. Rien à manger pendant des jours. Son mari meurt de faim. Certains décident que la situation est trop grave pour laisser passer l\'occasion : ils cuisinent le cadavre et font croire que c\'est de la mouette. Tout le monde y croit. Ils sont récupérés enfin par un bateau. Henriette constate dans le restaurant que le goût de la viande n\'a rien à voir avec ce qu\'elle a mangé sur l\'île : elle conclut qu\'elle a mangé son mari.', '1', '1'), ('192', '2', 'Voyage tragique', 'Ernest se rend d\'une ville A à une ville B en train. Au retour, il se tire une balle dans la tête. Pourquoi ?', 'Ernest était aveugle, il est parti se faire opérer des yeux dans la ville B. C\'est sa dernière tentative. S\'il ne retrouve pas la vue, il a prévu de se tuer. L\'opération réussit. Il retourne chez lui par le même train. Mais, en passant sous un tunnel, il crois être redevenu aveugle. Il se tire une balle dans la tête.', '1', '1'), ('193', '2', 'Le téléphone', 'Jules entend le téléphone sonner. Il dit : \"Oh non!\" et il meurt.', 'Jules croyait être le dernier survivant d\'une guerre nucléaire. Désespéré par la solitude, il se jette par la fenêtre d’un immeuble. Juste à ce moment, son téléphone sonne.', '1', '1'), ('194', '2', 'Face à face', 'Deux commerçants sont l\'un en face de l\'autre. Ils vendent les mêmes produits et pourtant ils ne se font pas concurrence. Pourquoi ?', 'Ce sont des pompistes sur l\'autoroute.', '1', '1'), ('195', '2', 'Le yacht abandonné', 'On trouve un yacht au milieu de l\'océan. Personne à bord. Dix corps flottent autour de lui. Que s\'est-il passé ?', 'Tous ont sauté à l\'eau pour prendre un bain. Puis, soit ils avaient descendu l\'échelle jusqu\'à l\'eau, et avec leur poids en moins, elle est remontée hors de portée, soit ils ont oublié de la descendre. En tous cas, ils se sont noyés.', '1', '1'), ('196', '2', 'La phrase', 'Quelle est la particularité de cette phrase : \"Servez un whisky à ces deux petits juges blonds qui fument\" ?', 'Elle comporte toutes les lettres de l’alphabet.', '1', '1'), ('197', '2', 'Moment exceptionnel', 'Le 5 juin 1978 à 12 h 34, un événement exceptionnel se produisit. Que s’est-il passé ?', 'A cet instant précis, on pouvait noter l’heure actuelle sous la forme\n12:34, 5/6/78.', '1', '1'), ('198', '2', 'L’allumette sur la tranche', 'Une allumette de carton peut-elle tomber sur la tranche ? Il existe un moyen très simple d’y parvenir à coup sûr.', 'Il suffit de la plier : elle forme un V et retombera toujours sur la tranche.', '1', '1'), ('199', '2', 'Invitation au cinéma', 'Au prix où sont les places, est-il plus avantageux d’inviter un ami au cinéma deux fois ou deux amis en même temps ?', 'Inviter deux amis en même temps entraîne l’achat de trois tickets ; en y allant deux fois, il faudra en acheter quatre.', '1', '1'), ('200', '2', 'Les mégots', 'Antoine, clochard de son état, ramasse chaque jour 49 mégots. Il lui faut récupérer exactement le tabac de 7 mégots pour se rouler une cigarette. Combien de cigarettes fume-t-il par jour ?', 'Huit. Avec les 49 mégots, il pourra fumer 7 cigarettes ; les mégots de celles-ci lui permettront de confectionner une huitième cigarette.', '1', '1'), ('201', '2', 'Plaques d’égout', 'Pourquoi une plaque d’égout est-elle toujours ronde ?', 'C’est la seule forme qui l’empêche de tomber dans le trou. Si elle avait deux dimensions différentes, elle pourrait tomber dans le trou car sa plus petite dimension passerait par la plus grande du trou. Pour une plaque carrée, la plus petite dimension serait le côté, et la plus grande, la diagonale !\nAccessoirement, on peut la déplacer plus facilement en la faisant rouler.', '1', '1'), ('202', '2', 'Quatre triangles', 'Comment obtenir quatre triangles avec six allumettes, sans les casser ni même les croiser ?', 'En les disposant en pyramide ! Placer trois allumettes en triangle, et les trois autres réunies au-dessus d’elles.', '1', '1'), ('203', '2', 'De plus en plus jeune', 'David avait 20 ans en 1990 et 15 ans en 1995. Comment cela est-il possible ?', 'David vivait en 1990 avant Jésus-Christ.', '1', '1'), ('204', '2', 'Point commun quatre', 'Pourquoi 2, 5, 7, 8, 9 et 11 ont-ils 4 comme point commun ?', 'Parce que deux, cinq, sept, huit, neuf et onze s’écrivent avec quatre lettres.', '1', '1'), ('205', '2', 'La déchirure', 'Un homme marche. Son pantalon se découd : il meurt ! Pourquoi ?', 'C’était un scaphandrier (ou un astronaute sur la lune). Si sa combinaison s’est déchirée, il n’a plus d’air.', '1', '1'), ('206', '2', 'Mensonge obligatoire', 'A quelle question est-il impossible de répondre « oui » sans mentir ?', '« Tu dors ? »', '1', '1'), ('207', '2', 'Qui suis-je ?', 'Je suis Sophie mais je ne suis pas Sophie. Qui suis-je ?', 'Je suis son chien et je la suis partout.', '1', '1'), ('208', '2', 'Récipient inversé', 'Qu’est-ce qui se remplit par le bas et se vide par le haut ?', 'Un puits.', '1', '1'), ('209', '2', 'Vision temporelle', 'Que peut-on voir une fois dans une minute, deux fois dans un moment et jamais dans un siècle ?', 'La lettre M.', '1', '1'), ('210', '2', 'Géographie', 'Où trouve-t-on des pays sans habitants, des villes sans maisons et des rivières sans eau ?', 'Dans les atlas géographiques.', '1', '1'), ('211', '2', 'Athlète', 'Qu’est-ce qui est capable de monter en haut d’un arbre de trente mètres mais qui se noie dans un verre d’eau ?', 'Une fourmi.', '1', '1'), ('212', '2', 'C’est bien à toi', 'Qu’est-ce qui t’appartient et que tout le monde utilise ?', 'Ton prénom.', '1', '1'), ('213', '2', 'Déplacement immobile', 'Qu’est-ce qui fait le tour de la pièce sans bouger ?', 'Le mur.', '1', '1'), ('214', '2', 'Myopie', 'Qu’est-ce qui porte des lunettes mais ne voit rien ?', 'Le nez.', '1', '1'), ('215', '2', 'Casser pour servir', 'Qu’est-ce qui ne sert à rien tant qu’il n’est pas cassé ?', 'Un œuf.', '1', '1'), ('216', '2', 'Handicap', 'Qu’est-ce qu’on peut écraser avec le pied droit mais pas avec le pied gauche ?', 'Le pied gauche.', '1', '1');
COMMIT;

