  `background_ny` varchar(255) DEFAULT NULL,
  `background_pz` varchar(255) DEFAULT NULL,
  `background_nz` varchar(255) DEFAULT NULL,
  `module_map` varchar(255) DEFAULT NULL,
  `action_map` text,
  `fonction` text,
  `bot` tinyint(3) unsigned DEFAULT '0',
  `title` varchar(255) DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17177 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

