-- ----------------------------
--  Table structure for `quetes`
-- ----------------------------
DROP TABLE IF EXISTS `quetes`;
CREATE TABLE `quetes` (
  `id_quete` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `element_detail_id_start` int(11) unsigned NOT NULL DEFAULT '0',
  `element_detail_id_stop` int(11) unsigned NOT NULL DEFAULT '0',
  `title` varchar(255) DEFAULT NULL,
  `type` tinyint(1) unsigned NOT NULL,
  `niveau` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `argent` int(11) unsigned NOT NULL DEFAULT '0',
  `xp` int(11) unsigned NOT NULL DEFAULT '0',
  `quete_id_parent` int(11) unsigned DEFAULT NULL,
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `fonction` text,
  `article_start` text,
  `article_stop` text,
  `article_help` text,
  PRIMARY KEY (`id_quete`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Records of `quetes`
-- ----------------------------
BEGIN;
INSERT INTO `quetes` VALUES ('1', '11847', '11861', 'Le jardinier a encore fait des bêtises', '1', '0', '20', '20', '0', '1', '', 'Bonjour et bienvenue {{joueur}},<br />\n<br />\nComme tu peux le constater, <br />\nle jardinier a arrosé la haie avec un peu trop d\'engrais. <br />\nIl faut trouver une solution pour sortir du jardin.<br />\n<br />\n<img src=\"./images/quetes/1/myhome.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', 'C\'est génial {{joueur}}, te voilà sur ton toit.<br />\nAide toi des arbres, si tu n\'as pas assez d\'élan.<br />\nTu trouveras d\'autres défis dans les autres maisons.', ' Que penses-tu d\'accéder au toit à l\'aide des caisses pour sauter par dessus la haie ?<br />\nJ\'ai calculé le nombre de caisses dont tu as besoin.<br />\n<h1><strong><span style=\"color: rgb(153, 204, 0);\">4 + 1</span></strong></h1>\n<img src=\"./images/quetes/1/myhome.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('4', '11860', '9723', 'Le parcours du grenier', '0', '0', '50', '50', '0', '1', '', 'Hello {{joueur}},<br />\n<br />\nJ\'ai un petit soucis, je ne retrouve plus une boite dont j\'ai besoin.<br />\nPeux tu aller dans le grenier, le récupérer pour moi ?<br />\n<br />\n<img src=\"./images/quetes/4/grenier.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', 'Tu viens de trouver la boite dans le grenier.', 'Il y a <strong><span style=\"color: rgb(153, 204, 0);\">12</span></strong> caisses dans cette pièce.<br />\n<strong><span style=\"color: rgb(153, 204, 0);\">10</span></strong> sont en trop pour pouvoir monter dans le grenier.<br />\nPense toujours à regarder où tu mets tes pieds.<br />\n<br />\n<img src=\"./images/quetes/4/grenier.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('5', '11886', '11885', 'Monter sur le toit', '0', '0', '60', '60', '0', '1', '', ' ¡Hola {{joueur}},<br />\n<br />\nSerais-tu capable de monter sur ma cheminée pour y vérifier que rien ne la bouche.<br />\n<br />\n<img src=\"./images/quetes/5/cheminee.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', ' Tiens! il y avait un nid que tu viens de déplacer juste a coté.', ' Pour réussir, tu devras te prendre pour un singe car le seul moyen à ma connaissance d\'y parvenir c\'est de te servir des arbres.<br />\n<img src=\"./images/quetes/5/cheminee.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('6', '12098', '12100', 'Monter sur le balcon', '0', '0', '80', '80', '0', '1', '', 'привет {{joueur}},<br />\n<br />\nJe voudrais savoir si tu es capable de monter sur le balcon.<br />\nDepuis que l\'escalier c\'est cassé, j\'ai rarement vu quelqu\'un y accéder.<br />\n<br />\n<img src=\"./images/quetes/6/balcon.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', 'La vue est vraiment sympa d\'ici.<br />\nTu fais parti de ceux qui savent sauter d\'arbre en arbre.', 'Il faut d\'aider du jardin pour pouvoir y parvenir. <br />\nTrouve le tas de terre qui dont la hauteur fait la moitié de la hauteur d\'un arbre.<br />\nCela t\'aidera à commencer ton parcourt.<br />\n<br class=\"Apple-interchange-newline\" />\n<span style=\"color: rgb(153, 204, 0); font-size: 24px; font-weight: bold;\">HAUTEUR DES L\'ARBRES / 2</span><br />\n<br />\n<img src=\"./images/quetes/6/balcon.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('7', '12618', '13563', 'La maison sur la colline', '0', '0', '100', '100', '0', '1', '', 'Ciao {{joueur}},<br />\n<br />\nPeux tu retrouver pour moi un bijou, que j\'ai laissé tomber dans la grotte qui se trouve en dessous de la maison.<br />\nL\'entrée de la grottre se trouve en bas de la colline près du labyrinthe.<br type=\"_moz\" />\nUne fois dedans, il y a un petite faille. Trouve la et entre dedans.<br />\n<br />\n<img src=\"./images/quetes/7/grotte.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', 'Tu viens de découvrir la grotte. <br />\nPour en re-sortir il te suffit d\'aller vers le haut.', 'Le bijoux se trouve à ce niveau dans la grotte :<br />\n<br class=\"Apple-interchange-newline\" />\n<font color=\"#99cc00\" size=\"5\"><b>( ( 2 + 5 ) * 2 ) - ( 8 + 6 )</b></font> <font color=\"#99cc00\" size=\"5\"><b> </b></font>  <br />\n<br />\n<img src=\"./images/quetes/7/grotte.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('8', '12621', '12624', 'Le labyrinthe', '0', '0', '220', '220', '0', '1', '', 'Hallo {{joueur}},<br />\n<br />\nPenses-tu avoir un bon sens d\'orientation?<br />\nje t\'invite à essayer le labyrinthe pour mieux le savoir.<br />\n<br />\n<img src=\"./images/quetes/8/labyrinthe.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', ' Tu viens de réussir le passage du labyrinthe.', 'Je n\'ai pas d\'astuce à te donner. <br />\nCela étant ne perd pas de temps à essayer de sauter ou à passer au dessus des haies.<br />\nElle a été fabriquer pour empêcher les petits malins d\'y parvenir en trichant.<br />\n<br />\n<img src=\"./images/quetes/8/labyrinthe.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('9', '16640', '12688', 'Grimper dans le grand arbre', '0', '0', '200', '200', '0', '1', '', ' Olá {{joueur}},<br />\n<br />\nUn défi qui prend de la hauteur.<br />\nCrois-tu avoir le niveau pour grimper sur le grand arbre sans tomber ?<br />\n<br />\n<img src=\"./images/quetes/9/arbre.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', ' Un vrai petit singe. <br />\nToi tu n\'as pas le vertige.', 'Pour bien commencer, place toi à droite de la cabane.<br />\nMais fait attention car si tu tombes de trop haut, ta barre de vie va se réduire.<br />\nL\'arbre a une entrée à XX cases de hauteur:<br />\n<br class=\"Apple-interchange-newline\" />\n<span style=\"color: rgb(153, 204, 0); font-size: 24px; font-weight: bold;\">18<br />\n––<br />\n 2</span><br />\n<br />\n<img src=\"./images/quetes/9/arbre.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('10', '9758', '12690', 'L\'étoile dans les nuages', '0', '0', '150', '150', '0', '1', '', ' こんにちは {{joueur}},<br />\n<br />\nCa fait bien longtemps que je n\'ai pas eu de visiteur dans mon arbre.<br />\nJ\'ai un secret à te dire, j\'ai caché une étoile dans les nuages il y a fort longtemps.<br />\nPeux tu aller voir si elle est bien toujours à sa place ?<br />\n<br />\n<img src=\"./images/quetes/10/nuage.png\" width=\"400\" height=\"216\" alt=\"\" /><br />\n<br />\n<br type=\"_moz\" />', ' L\'étoile est toujours dans les nuages. <br />\nMerci d\'être allé vérifier pour moi.', ' Une branche au dessus de la maison va d\'aider à monter jusqu\'au sommet de arbre pour mieux sauter sur les nuages.<br />\n<br />\n<img src=\"./images/quetes/10/nuage.png\" width=\"400\" height=\"216\" alt=\"\" />'), ('11', '12629', '12626', 'Qui peut couper l\'arrivée d\'eau ?', '0', '0', '180', '180', '0', '1', '', ' 你好 {{joueur}},<br />\n<br />\nJ\'ai un petit service à te demander. <br />\nSerais-tu assez sympa pour couper l\'arrivée d\'eau de la maison?<br />\nElle se trouve derrière la maison.<br />\n<br />\n<img src=\"./images/quetes/11/maison_seigneur.png\" width=\"400\" height=\"216\" alt=\"\" /><br type=\"_moz\" />', ' Cool, on va pouvoir faire des travaux pendant que l\'eau est coupée.', ' Tu vas devoir trouver une solution pour pouvoir te faufiler sur le coté de la maison car de souvenir, je ne crois pas qu\'il y est un accès direct.<br />\nL\'arrivée d\'eau ressemble à un gros interrupteur. <br />\n<br />\n<img src=\"./images/quetes/11/maison_seigneur.png\" width=\"400\" height=\"216\" alt=\"\" />');
COMMIT;

-- ----------------------------
--  Table structure for `regions`
-- ----------------------------
DROP TABLE IF EXISTS `regions`;
CREATE TABLE `regions` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `comment` text,
  `x` tinyint(3) unsigned NOT NULL DEFAULT '32',
  `y` tinyint(3) unsigned NOT NULL DEFAULT '32',
  `z` tinyint(3) unsigned DEFAULT '32',
  `id_parent` int(11) unsigned DEFAULT '0',
  `music` varchar(255) DEFAULT NULL,
  `bot_nbr_min` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_nbr_max` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_hp_min` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_hp_max` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_mp_min` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_mp_max` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_xp_min` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_xp_max` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_argent_min` int(11) unsigned NOT NULL DEFAULT '100',
  `bot_argent_max` int(11) unsigned NOT NULL DEFAULT '100',
  `bot_niveau` int(11) unsigned NOT NULL DEFAULT '0',
  `bot_attaque_min` smallint(4) unsigned NOT NULL DEFAULT '0',
  `bot_attaque_max` smallint(4) unsigned NOT NULL DEFAULT '0',
  `bot_defense_min` smallint(4) unsigned NOT NULL DEFAULT '0',
  `bot_defense_max` smallint(4) unsigned NOT NULL DEFAULT '0',
  `background_univers` varchar(255) DEFAULT 'images/panorama/1/panorama0.png',
  `background` varchar(255) DEFAULT 'images/background/grass.png',
  `background_color` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

