DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `email` varchar(127) NOT NULL,
  `username` varchar(32) NOT NULL DEFAULT '',
  `password` char(50) NOT NULL,
  `logins` int(10) unsigned NOT NULL DEFAULT '0',
  `last_login` int(10) unsigned DEFAULT NULL,
  `last_action` int(11) unsigned DEFAULT '0',
  `preambule` tinyint(3) unsigned DEFAULT '0',
  `ip` varchar(20) DEFAULT NULL,
  `avatar` varchar(50) DEFAULT 'default.png',
  `region_id` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `x` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `y` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `z` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `speed` tinyint(3) unsigned NOT NULL DEFAULT '3',
  `gravity` float unsigned NOT NULL DEFAULT '0.25',
  `currentdirection_x` smallint(5) NOT NULL DEFAULT '0',
  `argent` int(11) unsigned NOT NULL DEFAULT '10000',
  `niveau` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `xp` int(11) unsigned NOT NULL DEFAULT '0',
  `hp` mediumint(8) unsigned NOT NULL DEFAULT '100',
  `hp_max` mediumint(8) unsigned NOT NULL DEFAULT '100',
  `mp` mediumint(8) unsigned NOT NULL DEFAULT '100',
  `mp_max` mediumint(8) unsigned NOT NULL DEFAULT '100',
  `job_id` tinyint(3) unsigned DEFAULT '0',
  `item_id_handLeft` int(11) unsigned DEFAULT '0',
  `item_id_handRight` int(11) unsigned DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uniq_username` (`username`),
  UNIQUE KEY `uniq_email` (`email`),
  KEY `x` (`x`),
  KEY `y` (`y`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

